import React from 'react';
import Map from './Map';
import Toolbox from './Toolbox';
let x,y;
class App extends React.Component {

    area = (x,y) => {
        console.log(x,y);
    }


    render() {
        return (
            <div className="row">
                <div className="col-6">
                    <Map />
                </div>
                <div className="col-6">
                    <Toolbox area={this.area} />
                </div>
            </div>
        );
    }
};
export default App;
